import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input and type a partial query
    const searchInput = await page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });
    await searchInput.fill('iPhon');

    // Wait for the autocomplete suggestions to appear
    await page.waitForSelector('#searchSuggestions', { state: 'visible', timeout: 5000 });

    // Take a screenshot of the autocomplete suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete_visible.png'));

    // Extract the suggestions
    const suggestionItems = await page.locator('.suggestion-item').allTextContents();

    // Click the first suggestion
    const firstSuggestion = await page.locator('.suggestion-item').first();
    const firstSuggestionText = await firstSuggestion.textContent();
    await firstSuggestion.click();

    // Wait for the search results to be displayed after clicking the suggestion
    await page.waitForSelector('.search-results', { timeout: 5000 });

    // Take a final screenshot after selecting a suggestion
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestion_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestion_selected.png'));

    // Get the final value of the search input
    const finalInputValue = await searchInput.inputValue();

    return {
      success: true,
      action: "Tested search autocomplete by typing, verifying suggestions, and selecting an option.",
      extractedData: {
        initialSuggestions: suggestionItems,
        selectedSuggestion: firstSuggestionText.trim(),
        finalInputValue: finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
